import type { FC } from 'react'

import data from '@emoji-mart/data'
import { init } from 'emoji-mart'
import Image from 'next/image'
import style from './style.module.css'
import classNames from '@/utils/classnames'
import type { AppIconType } from '@/types/app'

export const DefaultIcon = 'data:image/png;base64,'

init({ data })

export type AppIconProps = {
  size?: 'xs' | 'tiny' | 'small' | 'medium' | 'large'
  rounded?: boolean
  iconType?: AppIconType | null
  icon?: string
  background?: string | null
  imageUrl?: string | null
  className?: string
  innerIcon?: React.ReactNode
  onClick?: () => void
  width?: number
  height?: number
}

const AppIcon: FC<AppIconProps> = ({
  size = 'medium',
  rounded = false,
  iconType,
  icon,
  background,
  imageUrl,
  className,
  onClick,
  width = 40,
  height = 40,
}) => {
  const wrapperClassName = classNames(
    style.appIcon,
    size !== 'medium' && style[size],
    rounded && style.rounded,
    className ?? '',
    'overflow-hidden',
  )

  const isValidImageIcon = iconType === 'image' && imageUrl

  const isNotDefault = (icon && icon !== '') && (icon.includes('base64') || icon.startsWith('http'))
  return (
    <span
      className={wrapperClassName}
      style={{
        background: (isNotDefault || isValidImageIcon) ? 'transparent' : (background || '#FFEAD5'),
      }}
      onClick={onClick}
    >
      {
        (isNotDefault || isValidImageIcon)
          ? <Image className='w-full h-full rounded-full' width={width} height={height} src={icon || `${imageUrl}`} alt='' />
          : <Image className='w-full h-full rounded-full' width={width} height={height} src={DefaultIcon} alt='' />
      }
    </span>
  )
}

export default AppIcon
